import { Link } from "react-router-dom";

const ProfileGroup = ({ group }) =>{
    return(
        <div className="">
            <Link className="link" to={`/groupe/${group.title}`}>
                {group.title}
                {group.image}
            </Link>
        </div>
    )
}

export default ProfileGroup;
